import React, {useState, useEffect} from "react";
import styled from 'styled-components'
import {ShadowLine, TitleArea} from "../../components/layout/Layout.Styled";

function Resume(props) {

  const {} = props;

  return (
      <Container>
          <TitleArea>
              <p>MY RESUME</p>
              <h2>
                  MY EXPERTISES
                  <ShadowLine mt={30}/>
              </h2>
          </TitleArea>
          <ResumeContainer>
              <div>
                  <div className="experience">
                      <div className="title">
                          <h3>My Experience</h3>
                      </div>
                      <div className="card">
                          <h5>Senior Architect</h5>
                          <h6>2015 - Present | Google</h6>
                          <p>Collaborate with creative and development teams on the execution of ideas.</p>
                      </div>
                      <div className="card">
                          <h5>Senior Architect</h5>
                          <h6>2015 - Present | Google</h6>
                          <p>Collaborate with creative and development teams on the execution of ideas.</p>
                      </div>
                  </div>
                  <div className="education">
                      <div className="title">
                          <h3>My Education</h3>
                      </div>
                      <div className="card">
                          <h5>Senior Architect</h5>
                          <h6>2015 - Present | Google</h6>
                          <p>Collaborate with creative and development teams on the execution of ideas.</p>
                      </div>
                  </div>
                  <div className="codingskills"></div>

              </div>
          </ResumeContainer>

      </Container>
  )

}

const Container = styled.div`

`;

const ResumeContainer = styled.div`
  display: flex;
  .title{
    font-size: 20px;
    margin: 16px 0 20px; 
  }
  .experience{
    float: left;
    padding: 0 15px;
  }
  .education{
  display: inline-block;
  }
  .card{
    background:#ffffff;
    height: 177px;
    width: 100%;
    margin: 24px 0 0;
    padding: 24px;
  }


`;


export default Resume;
